import React from 'react'
import '../P58.css'

const P58StairTitle = () => {
    return (
        <div className="box-container">
            <div className="box box-1 t">층</div>
            <div className="box box-2 t">시설</div>
            <div className="box box-3 t">설명</div>
        </div>
    )
}

export default P58StairTitle
